import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../all-projects/project-component/Projects.css';
import './Component.css';

const FloorComponent = ({ floor, projectTitle }) => {
    const navigate = useNavigate();

    const handleViewDetails = () => {
        navigate(`/floor/information/${floor.id}`, { state: { projectTitle } });
    };

    const handleSell = () => {
        alert(`Selling apartment with ID ${floor.id}`);
    };

    const handleAddApartment = () => {
        // Логика за добавяне на апартамент
        alert(`Adding floor with ID ${floor.id}`);
    };

    return (
        <div className="project-card" style={{ cursor: 'pointer', position: 'relative' }}>
            <div className="project-info" onClick={handleViewDetails}>
                <h2>Floor Nº {floor.number}</h2>
                
            </div>
        </div>
    );
};

export default FloorComponent;
